w.instagram.com/p/CEvFG8Ci_Hd";}i:150;a:1:{s:5:"image";s:238:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/118852998_3277343729023622_717848491361576964_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=102&_nc_ohc=75Xj0VmVYoAAX_jjDF4&oh=47bb12dc99679a66bc4f057b1da015f1&oe=5F556207";}i:151;a:1:{s:4:"type";s:5:"video";}i:152;a:1:{s:8:"owner_id";i:15128134;}i:153;a:1:{s:14:"owner_username";s:0:"";}i:154;a:1:{s:14:"owner_fullname";s:0:"";}i:155;a:1:{s:9:"owner_pic";s:0:"";}i:156;a:1:{s:2:"id";s:19:"2391152844558100145";}i:157;a:1:{s:10:"short_code";s:11:"CEvFNffjOax";}i:158;a:1:{s:12:"created_time";i:1599267653;}i:159;a:1:{s:7:"caption";s:1259:"Recently I've been obsessed with death. Not in a suicidal way. But I've been fearing it and dreading it and constantly thinking about it. It makes me uneasy and I can't enjoy living because I'll catch myself thinking about death and what happens after at odd moments. Life is only a journey to the end; however the journey is meant to be the significant part. I'm too focused on the end to concentrate here. I'm not sure why I'm having these thoughts or how to make it better. Life seems to be full of things for me to worry about and dread. It's exhausting. I, for one, feel overwhelmed. This quote makes me feel slightly better though. And I guess on somewhat positive news, I made it through without relapsing. 

